queries.callback:
_.chain(context)
.uniq(function(x) {
return x.REG
})
.map(function(place){
return {
data_value:place.REG,
display:{title: {text: place.REGIAO} } };
}).value()

_.map(context, function(place){place.data_value = place.TAB;
place.display = {title: {text: place.TABANCA} };
return place;
})

